var routerApp = angular.module('routerApp', ['ui.router', 'nvd3ChartDirectives', 'nvd3', 'ui.bootstrap'])

routerApp.config(function($stateProvider, $urlRouterProvider) {
    
    $urlRouterProvider.when('/live', '/live/real');
    $urlRouterProvider.when('/billing', '/billing/lastWeek');
    $urlRouterProvider.otherwise('/summary');
    $stateProvider
        
        // HOME STATES AND NESTED VIEWS ========================================
        .state('summary', {
            url: '/summary',
            templateUrl: 'partial-summary.html'
        })
        
        // ABOUT PAGE AND MULTIPLE NAMED VIEWS =================================
        .state('live', {
            url: '/live',
            templateUrl: 'partial-live.html'
        })
        // nested list with custom controller
        .state('live.real', {
            url: '/real',
            templateUrl: 'partial-live-real.html'
        })
        .state('live.pastToday', {
            url: '/pastToday',
            templateUrl: 'partial-live-past.html'
        })
        .state('billing', {
            url: '/billing',
            templateUrl: 'partial-billing.html'
        })
        .state('billing.lastWeek', {
            url: '/lastWeek',
            templateUrl: 'partial-billing-lastWeek.html'
        })
        .state('billing.lastMonth', {
            url: '/lastMonth',
            templateUrl: 'partial-billing-lastMonth.html'
        })
        .state('billing.lastBilling', {
            url: '/lastBilling',
            templateUrl: 'partial-billing-lastBilling.html'
        });

        
});

routerApp.controller('CarouselDemoCtrl', function ($scope) {
  $scope.myInterval = 5000;
  var slides = $scope.slides = [];
  $scope.addSlide = function() {
    var newWidth = 600 + slides.length + 1;
    slides.push({
      image: '1200x120.png',
      text: ['Turning your thermostat down by just 1 degree can reduce your energy consumption by over 5%.','Extra','Lots of','Surplus'][slides.length % 4]
    });
  };
  for (var i=0; i<4; i++) {
    $scope.addSlide();
  }
});

routerApp.controller('Real', function($scope) {
    $scope.options = {
        chart: {
            type: 'lineChart',
            height: 340,
            margin : {
                top: 20,
                right: 20,
                bottom: 40,
                left: 55
            },
            x: function(d){ return d.x; },
            y: function(d){ return d.y; },
            useInteractiveGuideline: true,
            transitionDuration:500,    
            yAxis: {
                tickFormat: function(d){
                   return d3.format('.01f')(d);
                }
            }
        }
    };
    $scope.options1 = angular.copy($scope.options);
    $scope.options1.chart.transitionDuration = 1;
    $scope.options1.chart.yDomain = [0,100];
    
    $scope.data = [{ values: [], key: 'Energy Usage (in Watts)' }];
        
    $scope.run = true;
    
    var x = 0;
    setInterval(function(){
        if (!$scope.run) return;
        $scope.data[0].values.push({ x: x,  y: 30*Math.random() + 30});
      if ($scope.data[0].values.length > 12)
            $scope.data[0].values.shift();
        x=x+10;
      $scope.$apply();
    }, 3000);        
});

